#!/usr/bin/perl -w
# $Id$

use Test;
use strict;
use lib './lib';

BEGIN {plan tests => 7}

use Digest::Perl::MD6 qw/md6 md6_hex md6_base64/;

# 1 Testsuite
if (1) {
	print "Trying md6_hex on test suite...\n";
	ok(
		md6_hex('')                                                                                 eq 'bca38b24a804aa37d821d31af00f5598230122c5bbfc4c4ad5ed40e4258f04ca' and
		md6_hex('a')                                                                                eq '2b0a697a081c21269514640aab4d74ffafeb3c0212df68ce92922087c69b0a77' and
		md6_hex('abc')                                                                              eq '230637d4e6845cf0d092b558e87625f03881dd53a7439da34cf3b94ed0d8b2c5' and
		md6_hex('message digest')                                                                   eq '4ea078009a8b6be888f3af98d459739fea25429af9c285f0927195450593db78' and
		md6_hex('abcdefghijklmnopqrstuvwxyz')                                                       eq '1650a8bcf2c9900da8677430c24c42a9d50b8ef001446cee704f05c89f6a840f' and
		md6_hex('ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789')                   eq 'c95dbfe4347644f14a8697066be24a85bcc296b18b738c058b8fc5a5553d8463' and
		md6_hex('12345678901234567890123456789012345678901234567890123456789012345678901234567890') eq 'c6351a8ccb961a12e037ec273e0cd74edc1bc606e539ec5a09fffa90f3cdd1f5'
	);
}

# 2 md6_base64
if (1) {
	print "Trying md6_base64...\n";
	ok (
		md6_base64('delta'   x 23) eq 'UOcwOhFx9pKAGh14h65BomOr3MlsNNiOgK1pFwzikx4' and
		md6_base64('carmen'  x 26) eq '7SSwRq+oXYKXZTrcoPRdi9mqm/X4f/ISAoU2Mff+Bt0' and
		md6_base64('imperia' x 42) eq 'nM1msDMCnliWqSRadtA5BdMRrAKTVItUDZ/7UmDZ0SI'
	);
}

# 3 d-test:
if (1) {
	print "Running d-test\n";
	my $err;
	while(<DATA>) {
		chomp;
		my ($plain, $cipher) = split/:/;
    #use Digest::MD6;
    #print $plain. ':' . Digest::MD6::md6_hex($plain) . "\n";
		$err++ if md6_hex($plain) ne $cipher;
	}
	ok(!$err);
}

# 4 Object
if (0) {
	print "Testing MD5-Object...\n";
	my $c = new Digest::Perl::MD5;
	$c->add('XdeltaX');
	ok(
		$c->b64digest eq 'hLA/iI1q1iIKz+uffnsN6w' and
		$c->add('YdeltaY')->hexdigest eq md5_hex('YdeltaY')
	);
}

# 5 Reset
if (0) {
	print "  - reset ";
	my $c = new Digest::Perl::MD5;
	$c->add('foo'); $c->reset(); $c->add('bar');
	ok( $c->hexdigest eq md5_hex('bar') );
}

# 5 Cloning
if (0) {
	print "  - clone ";
	my $c = new Digest::Perl::MD5;
	$c->add('YCarmenY'); my $d = $c->clone(); $c->add('ZKleinZ');
	# use Data::Dumper; print Dumper($c,$d);
	ok ( $c->b64digest eq $d->add('ZKleinZ')->b64digest );
}

# 6 Adding
if (0) {
	print "  - add ";
	my $c = new Digest::Perl::MD5;
	my $anz = 256;
	$c->add($_) for (0..$anz);
	my $string = 'x'x35701;
	ok (
		$c->b64digest eq md5_base64( 0..$anz ) and
		$c->add($string)->hexdigest eq md5_hex( $string )
	);
}

# 7 Addfile
if (0) {
	print "  - addfile ";
	#my $c = new Digest::Perl::MD6;
	use Digest::MD6;
	my $c = new Digest::MD6;

	open FILE, './rand.f' or die $!;
	binmode FILE;
#warn $c->addfile(*FILE)->hexdigest;
#	close FILE;
#
#	open FILE, './rand.f' or die $!;
#	binmode FILE;
	my $read = 0;
	my ($buffer, $data);
	$data .= $buffer while $read = read FILE, $buffer, 8192;
	die __PACKAGE__, " read failed: $!" unless defined $read;
#warn length $data;
#warn -s './rand.f';
warn Digest::Perl::MD6::md6_hex($data);
warn Digest::MD6::md6_hex($data);

	ok ( md6_hex($data) eq '452f1c15e7f2140747063fa2d4d89a84774fbf816b4c256bde8adb7b5702bf24' );
	# print $c->addfile(*FILE)->clone->hexdigest,"\n"; # DEBUG
	#ok ( $c->addfile(*FILE)->hexdigest eq '2cc2c8b037522964694985b3f9c88b1e' );
	#print $c->addfile(*FILE)->hexdigest ;
	close FILE;
}

# 8 add_bits
if (0) {
	print "  - add_bits ";
	my $c = new Digest::Perl::MD5;
	eval { $c->add_bits('', 9) };
	ok (
		$@ and
		$c->add_bits('011000010110001001100011')->digest eq md5('abc') and
		$c->add_bits('def', 16)->digest eq md5('de')
	);
}

# 9 Speed-Test
if (1) {
	use Time::HiRes qw/gettimeofday tv_interval/;
	print "Speed-Test (please be patient)...\n";

	my $count = $ENV{MD5_SPEED_TEST} || 1000;
	my $t1 = [gettimeofday];
	md6('delta') for 1 .. $count; # encode 64Byte blocks
	my $t2 = [gettimeofday];

	if ($t1->[0] == $t2->[0]) {
		print "Ok, you computer is fast. Please increase \$count in $0.\n";
	} else {
		printf "%d blocks took %.2fs => %.2f blocks/second.\n",
		$count, tv_interval($t1, $t2), $count/tv_interval($t1, $t2);
	}
}

